import React from 'react';
import './contactform.css'





function ContactForm() {



  return (
   <div className="contactform">
       <form action="">
           <div className="inp1">
               <label for="fname">First Name:</label>
               <input type="text" id="fname" name="fname" required/>
           </div>
           <div className="inp1">
               <label for="fname">First Name:</label>
               <input type="text" id="fname" name="fname" required/>
           </div>
           <div className="inp1">
               <label for="fname">First Name:</label>
               <input type="text" id="fname" name="fname" required/>
           </div>
       </form>
   </div>
  );
}

export default  ContactForm;
